@keyframes spin {
  from {
    transform: rotate(0);
  }
  to{
    transform: rotate(359deg);
  }
}
.three-quarter-spinner {
  width: 50px;
  height: 50px;
  border: 3px solid #5927e3;
  border-top: 3px solid transparent;
  border-radius: 50%;
  animation: spin .5s linear 0s infinite;
}
.cspinner-box{
    position: fixed;
    transform: translate(-50%, -50%);
    z-index: 10000;
    left: 50%;
    top: 50%;
    background: rgba(0, 0, 0, 0.2);
    height: 100%;
    width: 100%;
    display: flex;
    align-items: center;
    justify-content: center;
}
